The PR is to resolve #64, with the following changes:

As a result, the issue is to ask removing HTPassword user (project administrator) from UI, ARM template and scripts to simplify the user experience.

* Remove asking user for project administrator credentials from UI;
* Remove project administrator related pieces from ARM template and scripts;
* Remove `htpasswd-cr.yaml` which was used for creating HTPassword identity provider;

## Testing

The following test cases have already been passed before opening the PR:

* Successfully deployed the ARO 4 cluster and the Open Liberty sample image
* After deployment, manually signed in as `kubeadmin`, successfully created a new project, build and push the application image remotely and finally deployed an OpenLibertyApplication.

Here is the [preview link](https://portal.azure.com/#create/microsoft_javaeeonazure_test.20191212-arm-rhel-was-nd-v9-cluster-previewazure-liberty-aro) for live testing.

