-L137) with:
```
oc get deployment olo-controller-manager -n openshift-operators
```

As the Open Liberty Operator is **indirectly**  installed by OLM (Operator Lifecycle Manager) (see [Installing from OperatorHub using the CLI](https://docs.openshift.com/container-platform/4.10/operators/admin/olm-adding-operators-to-cluster.html#olm-installing-operator-from-operatorhub-using-cli_olm-adding-operators-to-a-cluster)) instead of being installed using kustomize/kubectl **directly** (see [Open Liberty Operator 0.8.0 installation guide](https://github.com/OpenLiberty/open-liberty-operator/tree/main/deploy/releases/0.8.0#installation)), it's possible that the Open Liberty Operator is still not available after the current maximum retry times (99) for some edge cases.

So the fix is to increase the maximum retry times to 299, which is ~3 times of the current value, to mitigate the issue. We'll monitor if the issue won't be reproduced after change, then decide the appropriate action if it happens again, e.g., increase to a bigger value or make it an infinitely loop.", 'reactions': {'url': 'https://api.github.com/repos/WASdev/azure.liberty.aro/issues/comments/1077014797/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

